(11, 6, 'Haven Hall', 'Haven Hall offers a comfortable and vibrant living space tailored specifically for students. Nestled in the heart of the city, our accommodation provides a safe and welcoming environment where students can thrive academically and socially. With modern amenities, spacious rooms, and communal areas designed for collaboration and relaxation, Haven Hall is more than just a place to stay  it&#39;s a home away from home. Our dedicated staff are committed to ensuring every resident feels supported and part of a diverse and inclusive community. Experience the convenience, comfort, and camaraderie that Haven Hall has to offer, making your university years truly memorable.', 12000.00, 'https://www.google.com/maps/@6.822258890454811,80.02438752441407,13z?entry=ttu', 'approved', '2024-04-07 19:00:12', '2024-04-07 19:54:08', 6.82225889, 80.02438752, );
